import React, { useState, useCallback } from 'react';
import { Box, IconButton, Paper, Tooltip } from '@mui/material';
import { styled } from '@mui/material/styles';
import { DragIndicator as DragIcon, Add as AddIcon, Close as CloseIcon } from '@mui/icons-material';
import { Resizable } from 're-resizable';
import { DragDropContext, Droppable, Draggable } from 'react-beautiful-dnd';

const PanelContainer = styled(Box)(({ theme }) => ({
  display: 'flex',
  flexDirection: 'row',
  height: 'calc(100vh - 16px)', // Account for margin
  width: '100%',
  overflow: 'hidden',
  padding: theme.spacing(1),
}));

const Panel = styled(Paper)(({ theme }) => ({
  display: 'flex',
  flexDirection: 'column',
  height: '100%',
  flex: 1,
  minWidth: 300,
  position: 'relative',
  overflow: 'hidden',
  backgroundColor: theme.palette.background.default,
}));

const PanelHeader = styled(Box)(({ theme }) => ({
  display: 'flex',
  alignItems: 'center',
  padding: theme.spacing(1, 2),
  borderBottom: `1px solid ${theme.palette.divider}`,
  backgroundColor: theme.palette.background.paper,
  cursor: 'move',
  userSelect: 'none',
}));

const PanelContent = styled(Box)({
  flex: 1,
  overflow: 'auto',
  position: 'relative',
  height: 'calc(100% - 48px)', // Account for header height
});

const AddPanelButton = styled(IconButton)(({ theme }) => ({
  position: 'fixed',
  bottom: theme.spacing(2),
  right: theme.spacing(2),
  zIndex: theme.zIndex.drawer + 1,
}));

function PanelLayout({ children }) {
  const [panels, setPanels] = useState([
    { id: 'panel-1', width: '50%' },
    { id: 'panel-2', width: '50%' }
  ]);

  const handleDragEnd = useCallback((result) => {
    if (!result.destination) return;

    const items = Array.from(panels);
    const [reorderedItem] = items.splice(result.source.index, 1);
    items.splice(result.destination.index, 0, reorderedItem);

    setPanels(items);
  }, [panels]);

  const handleResize = (index, size) => {
    setPanels(prev => {
      const newPanels = [...prev];
      newPanels[index] = { ...newPanels[index], width: size.width };
      return newPanels;
    });
  };

  const handleRemovePanel = (panelId) => {
    if (panels.length > 1) {
      setPanels(prev => {
        const newPanels = prev.filter(p => p.id !== panelId);
        // Redistribute widths
        const newWidth = `${100 / newPanels.length}%`;
        return newPanels.map(p => ({ ...p, width: newWidth }));
      });
    }
  };

  const handleAddNewPanel = () => {
    setPanels(prev => {
      const newWidth = `${100 / (prev.length + 1)}%`;
      return [
        ...prev.map(p => ({ ...p, width: newWidth })),
        { id: `panel-${prev.length + 1}`, width: newWidth }
      ];
    });
  };

  return (
    <>
      <DragDropContext onDragEnd={handleDragEnd}>
        <Droppable droppableId="panels" direction="horizontal">
          {(provided) => (
            <PanelContainer
              ref={provided.innerRef}
              {...provided.droppableProps}
            >
              {panels.map((panel, index) => (
                <Draggable key={panel.id} draggableId={panel.id} index={index}>
                  {(provided) => (
                    <Resizable
                      size={{ width: panel.width, height: '100%' }}
                      onResizeStop={(e, direction, ref) => {
                        handleResize(index, {
                          width: ref.style.width,
                        });
                      }}
                      enable={{
                        right: index < panels.length - 1,
                        left: index > 0,
                      }}
                      minWidth={300}
                      maxWidth="80%"
                      handleStyles={{
                        right: { width: '8px', right: '-4px' },
                        left: { width: '8px', left: '-4px' },
                      }}
                      handleClasses={{
                        right: 'resize-handle',
                        left: 'resize-handle',
                      }}
                    >
                      <Panel
                        ref={provided.innerRef}
                        {...provided.draggableProps}
                        elevation={2}
                      >
                        <PanelHeader {...provided.dragHandleProps}>
                          <DragIcon sx={{ mr: 1 }} />
                          Chat Window {index + 1}
                          {panels.length > 1 && (
                            <IconButton
                              size="small"
                              onClick={() => handleRemovePanel(panel.id)}
                              sx={{ ml: 'auto' }}
                            >
                              <CloseIcon fontSize="small" />
                            </IconButton>
                          )}
                        </PanelHeader>
                        <PanelContent>
                          {typeof children === 'function' ? children(panel.id) : children}
                        </PanelContent>
                      </Panel>
                    </Resizable>
                  )}
                </Draggable>
              ))}
              {provided.placeholder}
            </PanelContainer>
          )}
        </Droppable>
      </DragDropContext>
      
      <Tooltip title="Add new chat window">
        <AddPanelButton
          color="primary"
          onClick={handleAddNewPanel}
          size="large"
        >
          <AddIcon />
        </AddPanelButton>
      </Tooltip>
    </>
  );
}

export default PanelLayout;
